        console.log("here");
    }

    render() {
        return(
            <div id='appContainer' className='screen'>

                <aside id='navContainer'>
                    <div id='navTop'>
                    <img src={require('../../resources/img/logo.png')} alt="agrosense logo"/>
                    </div>
                    <nav>
                        <ul>
                            <li onClick={this.changeUtility} className='navActive'><p><i className="fa-solid fa-table-cells-large"></i>Dashboard</p></li>
                            <li onClick={this.changeUtility}><p><i className="fa-solid fa-cloud-sun"></i>Weather</p></li>
                            <li><p><i className="fa-solid fa-desktop"></i>Monitor</p></li>
                            <li><p><i className="fa-solid fa-boxes-stacked"></i>Resources</p></li>
                            <li><p><i className="fa-regular fa-map"></i>Maps</p></li>
                            <li><p><i className="fa-solid fa-bullhorn"></i>Predictions</p></li>
                        </ul>
                    </nav>
                    <hr className='greenLine'/>
                </aside>

                <main id='utilityContainer'>



                </main>

            </div>
        )
    }

}

export default Dashboard;
